import React from 'react';
import styled from 'styled-components';

function StatusBars() {
  return (
    <Wrapper>
      <div>Health</div>
      <div>Experience?</div>
      <div>Hype (for in-fight display only)</div>
    </Wrapper>
  );
}

const Wrapper = styled.div`
  grid-area: bars;
  border: 1px solid black;
  border-radius: 8px;
  padding: 8px;
  margin: 16px;
`;

export default StatusBars;
